webpackJsonp([350],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-how-to-get-help-on-gitter.json":function(e,t){e.exports={data:{markdownRemark:{html:'<p>Sorry that you are stuck. Luckily there are many campers who hang out on Gitter and can help you resolve most issues! Follow these simple steps to get help fast:</p>\n<ol>\n<li>\n<p>Go to the <a href="https://gitter.im/FreeCodeCamp/Help">Help Room</a></p>\n<ul>\n<li>If the problem is code related, paste the problematic code in the chat room with the <a href="http://forum.freecodecamp.com/t/markdown-code-formatting/18391">Proper Formatting</a> and a description of the issue.</li>\n<li>If the problem seems to be with the site itself, post a screenshot of the issue or describe it well.</li>\n</ul>\n</li>\n<li>\n<p>Remember that the people there are campers just like you, so be courteous!</p>\n</li>\n<li>\n<p>If your problem has baffled everyone in Gitter, try <a href="http://forum.freecodecamp.com/t/searching-for-existing-issues-in-github/18390">Searching for Your Issue on Github</a> for anyone who has posted about a similar issue.</p>\n</li>\n</ol>',frontmatter:{title:"How to Get Help on Gitter",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/how-to-get-help-on-gitter/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/how-to-get-help-on-gitter/"}}}});
